// BORDER RULES
int8_t CheckRows(int16_t y, int16_t newx){
	//Row 1
	if(y == 144){
		if((newx >= 2) && (newx <= 117)){
			return(1);
		}
	}
	
	//Row 2
	if(y == 130){
		if(((newx >= 2) && (newx<=23)) || ((newx >= 37) && (newx<=51)) || ((newx >= 68) && (newx <= 82)) || ((newx >= 96) && (newx <= 117))){
			return(1);
		}
	}
	
	//Row 3
	if(y == 116){
		if(((newx >= 2) && (newx <= 9)) || ((newx >= 23) && (newx <= 96)) || ((newx >= 110) && (newx <= 117))){
			return(1);
		}
	}
	
	//Row 4
	if(y == 102){
		if(( newx >= 2 & newx <= 51) | (newx >= 68 & newx <= 117)){
			return(1);
		}
	}
	
	//Row 5
	if(y == 46){
		if(((newx >= 2) & (newx <= 23)) || ((newx >= 37) && (newx <= 51)) || ((newx >= 68) && (newx<= 82)) || ((newx >= 96) && (newx <= 117))){
			return(1);
		}
	}
	
	//Row 6
	if(y == 32){
		if((newx >= 2 && newx <= 117)){
			return(1);
		}
	}
	
	//Row 7
	if(y == 11)
		if((newx >= 2 & newx <= 51) | (newx >= 68 & newx<= 117)){
			return(1);
		}
	
	//Middle Row
	if(y == 74){
		if((newx >= -9 & newx <= 37) | (newx >= 82 & newx <= 128)){
			return(1);
		}
	}
	
	//Top and Bottom of Ghost box
	if(y == 88 | y == 60){
		if((newx>= 37 & newx<= 82)){
			return(1);
		}
	}
	return(0);
}
	
int8_t CheckCols(int16_t x, int16_t newy){
	//Column 1 & 10
	if(x == 2 | x == 117){
		if(((newy >= 11) && (newy <= 46)) || ((newy >= 102) && (newy <= 116)) || ((newy >= 130) && (newy <= 144))){
			return(1);
		}
	}
	
	//Column 2 & 9
	if(x == 9 | x == 110){
		if((newy >= 116 & newy <= 130)){
			return(1);
		}
	}
	
	//Column 3 & 8
	if(x == 23 | x == 96){
		if((newy >= 11 & newy <= 130)){
			return(1);
		}
	}
	
	//Column 4 & 7
	if(x == 37 | x == 82){
		if((newy >= 32 & newy <= 46) | (newy >= 116 & newy <= 130) | (newy >= 60 & newy <= 102)){
			return(1);
		}
	}
	
	//Column 5 & 6
	if(x == 51 | x == 68){
		if((newy >= 11 & newy <= 32) | (newy >= 46 & newy <= 60) | (newy >= 102 & newy <= 116) | (newy >= 130 & newy<= 144)){
			return(1);
		}
	}
	return(0);
}

